import React from "react";

class DigitalTime extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      time: new Date().toLocaleTimeString,
    };
  }

  render() {
    return (
      <>
        <h1>Digital Time: {this.state.time}</h1>
      </>
    );
  }
}

export default DigitalTime;
